import React from "react";
import { 
  Paper, 
  Table, 
  TableBody, 
  TableCell, 
  TableContainer, 
  TableHead, 
  TableRow, 
  Typography, 
  Box,
  Alert,
  useTheme
} from '@mui/material';
import { styled } from '@mui/material/styles';

// 비교할 항목을 FIELDS에 정의
const FIELDS = [
  { key: "sprtTrgtCn", label: "지원대상" },
  { key: "wlfareInfoReldCn", label: "문의처 연락처" },
  { key: "wlfareInfoReldNm", label: "문의처 이름" },
  { key: "aplyMtdCn", label: "신청방법" },
  { key: "alwServCn", label: "지원내용" },
  { key: "basfrmList", label: "관련 자료 링크" }
];

// 스타일링된 컴포넌트
const StyledTableCell = styled(TableCell)(({ theme }) => ({
  '&.header': {
    backgroundColor: theme.palette.primary.main,
    color: theme.palette.common.white,
    fontWeight: 'bold',
    fontSize: 16,
  },
  '&.field-label': {
    backgroundColor: theme.palette.grey[100],
    fontWeight: 'bold',
    width: '20%',
    textAlign: 'center',
    verticalAlign: 'middle',
  },
  '&.policy-cell': {
    width: '40%',
    padding: theme.spacing(2),
    '& a': {
      color: theme.palette.primary.main,
      textDecoration: 'none',
      '&:hover': {
        textDecoration: 'underline',
      },
    },
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
  // hide last border
  '&:last-child td, &:last-child th': {
    border: 0,
  },
}));

// 각 정책에서 비교 항목 값을 추출하는 함수
function getFieldValue(policy, key) {
  if (!policy || !policy.json || !policy.json.wantedDtl) return "-";
  const wantedDtl = policy.json.wantedDtl;
  switch (key) {
    case "sprtTrgtCn":
      return wantedDtl.sprtTrgtCn || "-";
    case "wlfareInfoReldCn":
      return wantedDtl.inqplCtadrList?.wlfareInfoReldCn || "-";
    case "wlfareInfoReldNm":
      return wantedDtl.inqplCtadrList?.wlfareInfoReldNm || "-";
    case "aplyMtdCn":
      return wantedDtl.aplyMtdCn || "-";
    case "alwServCn":
      return wantedDtl.alwServCn || "-";
    case "basfrmList":
      // basfrmList가 배열 또는 객체일 수 있음
      if (Array.isArray(wantedDtl.basfrmList)) {
        // 여러 개면 첫 번째만 표시, 필요시 map으로 여러 개 표시 가능
        return wantedDtl.basfrmList[0]?.wlfareInfoReldCn
          ? <a href={wantedDtl.basfrmList[0].wlfareInfoReldCn} target="_blank" rel="noopener noreferrer">{wantedDtl.basfrmList[0].wlfareInfoReldNm || "관련 자료"}</a>
          : "-";
      } else if (wantedDtl.basfrmList?.wlfareInfoReldCn) {
        // 객체일 경우
        return <a href={wantedDtl.basfrmList.wlfareInfoReldCn} target="_blank" rel="noopener noreferrer">{wantedDtl.basfrmList.wlfareInfoReldNm || "관련 자료"}</a>;
      }
      return "-";
    default:
      return "-";
  }
}

function PolicyCompare({ policies = [] }) {
  const theme = useTheme();

  // 정책이 충분하지 않은 경우 처리
  if (!policies || policies.length < 2) {
    return (
      <Box sx={{ my: 3 }}>
        <Alert severity="info" variant="outlined">
          비교할 정책이 충분하지 않습니다. 두 개의 정책을 선택해주세요.
        </Alert>
      </Box>
    );
  }

  const [left, right] = policies;

  // 두 정책 비교 표시
  return (
    <Box sx={{ my: 3 }}>
      <Typography variant="h5" component="h2" gutterBottom sx={{ 
        fontWeight: 'bold',
        color: theme.palette.primary.main,
        borderBottom: `2px solid ${theme.palette.primary.main}`,
        pb: 1,
        mb: 2
      }}>
        정책 비교
      </Typography>

      <TableContainer component={Paper} elevation={3} sx={{ borderRadius: 2, overflow: 'hidden' }}>
        <Table sx={{ minWidth: 650 }} aria-label="정책 비교 테이블">
          <TableHead>
            <TableRow>
              <StyledTableCell className="header">{left?.json?.wantedDtl?.servNm || "정책 1"}</StyledTableCell>
              <StyledTableCell className="header" align="center">항목</StyledTableCell>
              <StyledTableCell className="header">{right?.json?.wantedDtl?.servNm || "정책 2"}</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {FIELDS.map((field) => (
              <StyledTableRow key={field.key}>
                <StyledTableCell className="policy-cell">{getFieldValue(left, field.key)}</StyledTableCell>
                <StyledTableCell className="field-label">{field.label}</StyledTableCell>
                <StyledTableCell className="policy-cell">{getFieldValue(right, field.key)}</StyledTableCell>
              </StyledTableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
}

export default PolicyCompare;
